import tkinter as tk
from queue import PriorityQueue
import time

#######################################################
#Cell class
#######################################################
class Cell:
    def __init__(self, x, y, is_wall=False):
        self.x = x
        self.y = y
        self.is_wall = is_wall
        self.g = float("inf")
        self.h = 0
        self.f = float("inf")
        self.parent = None

    def __lt__(self, other):
        return self.f < other.f

#######################################################
# MazeGame class
#######################################################
class MazeGame:
    def __init__(self, root, maze, algorithm="A*", title="Maze"):
        self.root = root
        self.maze = maze
        self.algorithm = algorithm
        self.rows = len(maze)
        self.cols = len(maze[0])
        self.agent_pos = (0,0)
        self.goal_pos = (self.rows-1, self.cols-1)
        self.cells = [[Cell(x, y, maze[x][y]==1) for y in range(self.cols)] for x in range(self.rows)]
        self.cell_size = 5
        self.canvas = tk.Canvas(root, width=self.cols*self.cell_size, height=self.rows*self.cell_size+30, bg="white")
        self.canvas.pack(side=tk.LEFT, padx=10)
        self.root.title(title + " - " + algorithm)
        self.draw_maze()
        self.start_time = time.time()
        self.find_path()
        self.end_time = time.time()
        self.show_time()

    # Draw maze
    def draw_maze(self):
        for x in range(self.rows):
            for y in range(self.cols):
                color = "maroon" if self.maze[x][y]==1 else "white"
                self.canvas.create_rectangle(y*self.cell_size, x*self.cell_size,
                                             (y+1)*self.cell_size, (x+1)*self.cell_size,
                                             fill=color, outline="black")

    # Manhattan heuristic
    def heuristic(self, pos):
        return abs(pos[0]-self.goal_pos[0]) + abs(pos[1]-self.goal_pos[1])

    # Find path
    def find_path(self):
        open_set = PriorityQueue()
        start = self.agent_pos
        self.cells[start[0]][start[1]].g = 0
        self.cells[start[0]][start[1]].h = self.heuristic(start)
        self.cells[start[0]][start[1]].f = self.cells[start[0]][start[1]].h if self.algorithm=="GBF" else self.cells[start[0]][start[1]].g + self.cells[start[0]][start[1]].h

        open_set.put((self.cells[start[0]][start[1]].f, start))
        open_dict = {start: self.cells[start[0]][start[1]].f}

        while not open_set.empty():
            _, current_pos = open_set.get()
            current_cell = self.cells[current_pos[0]][current_pos[1]]

            if current_pos == self.goal_pos:
                self.reconstruct_path()
                return

            for dx, dy in [(0,1),(0,-1),(1,0),(-1,0)]:
                new_pos = (current_pos[0]+dx, current_pos[1]+dy)
                if 0<=new_pos[0]<self.rows and 0<=new_pos[1]<self.cols:
                    neighbor = self.cells[new_pos[0]][new_pos[1]]
                    if neighbor.is_wall:
                        continue

                    if self.algorithm == "GBF":
                        f_new = self.heuristic(new_pos)
                        if new_pos not in open_dict or f_new < open_dict[new_pos]:
                            neighbor.parent = current_cell
                            neighbor.f = f_new
                            open_set.put((f_new, new_pos))
                            open_dict[new_pos] = f_new
                    else:  # A*
                        g_new = current_cell.g + 1
                        f_new = g_new + self.heuristic(new_pos)
                        if g_new < neighbor.g:
                            neighbor.g = g_new
                            neighbor.h = self.heuristic(new_pos)
                            neighbor.f = f_new
                            neighbor.parent = current_cell
                            open_set.put((f_new, new_pos))
                            open_dict[new_pos] = f_new

    # Reconstruct path
    def reconstruct_path(self):
        current = self.cells[self.goal_pos[0]][self.goal_pos[1]]
        while current.parent:
            x, y = current.x, current.y
            self.canvas.create_rectangle(y*self.cell_size, x*self.cell_size,
                                         (y+1)*self.cell_size, (x+1)*self.cell_size,
                                         fill="green")
            current = current.parent

    #### Show runtime
    def show_time(self):
        elapsed = self.end_time - self.start_time
        self.canvas.create_text(self.cols*self.cell_size/2, self.rows*self.cell_size+10,
                                text=f"{self.algorithm} Time: {elapsed:.4f}s", anchor="n", font=("Arial", 12, "bold"))

