def run_all_mazes():
    for maze_name, maze_data in mazes:
        root_a = tk.Tk()
        MazeGame(root_a, maze_data, algorithm="A*", title=maze_name)
        root_a.update()

        root_g = tk.Toplevel()
        MazeGame(root_g, maze_data, algorithm="GBF", title=maze_name)
        root_g.update()

run_all_mazes()
tk.mainloop()